INSERT INTO `company_blogs` VALUES (1,'4 Tips Memakai Lipstik untuk Bibir Tebal, Yuk Coba Praktekin!','4-tips-memakai-lipstik-untuk-bibir-tebal-yuk-coba-praktekin','<p>Bagi kalian yang memiliki bibir tebal, cobain dulu deh <em>Teens </em>tips memakai lipstik untuk bibir tebal berikut ini. Menggunakan cara yang tepat saat memakai lipstik bisa menyamarkan bibir kalian yang tebal lho.</p>\r\n<p>Memiliki bibir yang tebal memang tak selamanya membuat para pemiliknya bangga. Ada juga yang merasa tak percaya diri sehingga takut memakai lipstik karena bibirnya bisa terlihat sangat menonjol.</p>\r\n<p>Nah, daripada kalian takut menggunakan lipstik, lebih baik ketahui dulu tips memakai lipstik untuk bibir tebal berikut ini agar bibir kalian terlihat tipis dan cantik ya.</p>\r\n<p><strong>Gunakan foundation</strong></p>\r\n<p>Sebelum mengaplikasikan lipstik ke bibir, kalian harus memakai foundation terlebih dahulu nih <em>Teens</em>. Berikan foundation secara tipis-tipis ke bibir dan ratakan. Foundation bisa membuat lipstik tahan lama dan menyamarkan garis bibir.</p>\r\n<p><strong>Gunakan lipstik yang bertekstur matte</strong></p>\r\n<div id=\"outstream_article\" data-id=\"297\" data-m=\"{\"> </div>\r\n<p>Bibir yang tebal sebaiknya menggunakan lipstik yang bertekstur matte lho <em>Teens</em>. Lebih baik kalian menghindari penggunaan lipstik bertekstur <em>glossy</em> karena bisa membuat bibir terlihat lebih bervolume. Selain itu, jangan aplikasikan <em>lip gloss</em> setelah menggunakan lipstik ya.</p>\r\n<p><strong>Gunakan lip liner</strong></p>\r\n<p>Lip liner juga menjadi hal yang perlu kalian miliki nih <em>Teens</em>. Jadi dengan lip liner kalian bisa membuat garis di bagian dalam garis bibir sehingga akan membentuk bibir yang terlihat lebih tipis.</p>\r\n<p><strong>Gunakan lipstik berwarna natural dan agak gelap</strong></p>\r\n<p>Warna lipstik yang cocok digunakan oleh pemilik bibir tebal adalah warna-warna yang agak gelap dan natural <em>Teens</em>. Misalnya saja warna nude, marun, cokelat, baby pink dan peach adalah warna-warna yang tepat untuk pemilik bibir tebal lho.</p>\r\n<p>Tips memakai lipstik untuk bibir tebal di atas cukup mudah untuk dilakukan kan <em>Teens</em>, jadi selamat mencoba ya!</p>','4-tips-memakai-lipstik-untuk-bibir-tebal-yuk-coba-praktekin20171124234128','2017-11-24 16:32:25','azmicolejr','2017-11-25 05:41:28','azmicolejr'),(2,'8 Cara Jenius Untuk Memakai Eyeliner Bagi Pemula','8-cara-jenius-untuk-memakai-eyeliner-bagi-pemula','<p>Eyeliner merupakan salah satu bagian make up yang sangat penting! Dengan memakai eyeliner, kamu bisa membuat penampilanmu semakin segar dan tegas. Sayangnya, banyak wanita yang masih kesulitan dalam memakai eyeliner, terutama bagi para pemula dan mereka yang sedang belajar membuat <em>cat-eye</em> yang dramatis.</p>\r\n<p>Nah, berikut ini ada 8 cara jenius untuk memakai eyeliner. Apakah kalian sudah mengetahuinya?</p>\r\n<h3>1. Ketahui posisi memakai eyeliner yang benar</h3>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3546.jpg\" alt=\"Cara memakai eyeliner dengan posisi yang benar\" width=\"637\" height=\"346\"></p>\r\n<p>Sumber: <a href=\"https://www.buzzfeed.com/nataliebrown/because-cat-eyes-are-hard?utm_term=.hdD4PQ0Xe#.oxBM6Djz0\" target=\"_blank\" rel=\"noopener noreferrer\">buzzfeed</a></p>\r\n<p>Posisi memakai eyeliner yang salah akan menyulitkanmu memakai eyeliner. Daripada memakainya sambil berdiri, lebih baik kamu duduk dan letakkan tangan kananmu di meja yang stabil, lalu letakan jari kelingkingmu di pipi untuk menghindari kesalahan yang tidak diinginkan.</p>\r\n<h3>2. Jangan tarik ujung matamu!</h3>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3548.jpg\" alt=\"Jangan menarik ujung mata saat memakai eyeliner\" width=\"637\" height=\"318\"></p>\r\n<p>Sumber: <a href=\"http://www.cosmopolitan.com/style-beauty/beauty/news/a33923/hacks-for-fixing-makeup-mistakes/\" target=\"_blank\" rel=\"noopener noreferrer\">cosmopolitan</a></p>\r\n<p>Kulit di area mata merupakan kulit yang tipis. Menarik ujung matamu seperti ini dapat membuat kulit matamu lebih cepat kendur. Tidak apa-apa melakukan kesalahan saat memakai eyeliner, kamu bisa menghapusnya menggunakan <em>cotton bud</em>.</p>\r\n<h3>3. Buat titik-titik atau garis-garis</h3>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3547.jpg\" alt=\"Cara memakai eyeliner dengan membuat garis petunjuk\" width=\"637\" height=\"637\"></p>\r\n<p>Sumber: <a href=\"http://theglossy.sephora.com/articles/1053/the-tip-off-daytime-drama?om_mmc=aff-linkshare-redirect-TnL5HPStwNw&c3ch=Linkshare&c3nid=TnL5HPStwNw&affid=TnL5HPStwNw-_aB6_3fIjCurTZZgLD0Hng&ranEAID=TnL5HPStwNw&ranMID=2417&ranSiteID=TnL5HPStwNw-_aB6_3fIjCurTZZgLD0Hng&ranLinkID=10-1&browserdefault=true\" target=\"_blank\" rel=\"noopener noreferrer\">theglossy.sephora</a></p>\r\n<p>Kamu bisa membuat titik-titik atau garis-garis pada kelopak matamu terlebih dahulu. Setelah itu, pakailah eyelinermu seperti biasa. Fungsi titik-titik atau garis-garis ini adalah untuk menjadi panduanmu memakai eyeliner.</p>\r\n<h3>4. Gunakan Sendok</h3>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3549.jpg\" alt=\"Cara memakai eyeliner dengan sendok\" width=\"637\" height=\"370\"></p>\r\n<p>Untuk membuat bentuk<em> cat-eye</em> yang sempurna, kamu bisa menggunakan bantuan peralatan rumah, seperti sendok. Kamu hanya perlu meletakkan di ujung mata dna menjadikannya panduan untuk memakai eyeliner.</p>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3550.jpg\" alt=\"Cara memakai eyeliner dengan kartu nama\" width=\"637\" height=\"838\"></p>\r\n<p>Sumber: <a href=\"http://www.cosmopolitan.com/style-beauty/beauty/how-to/a31500/eyeliner-hacks-every-woman-must-know/\" target=\"_blank\" rel=\"noopener noreferrer\">cosmopolitan</a></p>\r\n<p>Tidak hanya sendok, kamu juga bisa gunakan kartu nama sebagai panduan membuat cat-eye.</p>\r\n<h3>5. Gambar <em>cat-eye</em> dari bagian luar mata</h3>\r\n<p>Membuat <em>cat-eye</em> dari luar mata akan jauh lebih mudah, lho! Pastikan kamu menggunakan eyeliner terbaik untuk mendapatkan hasil maksimal seperti <a href=\"https://nadeko.co.id/heroine-make-smooth-liquid-eyeliner-super.html?utm_source=kawaiibeautyjapan&utm_medium=advertorial&utm_campaign=2016614-Kiss Me By Isehan 20% all product\" target=\"_blank\" rel=\"noopener noreferrer\">Kiss Me By Isehan Heroine Make Smooth Liquid Eyeliner Super</a>.</p>\r\n<h3>6. Buat tanda pagar</h3>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3551.jpg\" alt=\"Cara memakai eyeliner dan membuat smoky eyes\" width=\"637\" height=\"427\"></p>\r\n<p>Sumber: <a href=\"http://www.cosmopolitan.com/style-beauty/beauty/how-to/a31500/eyeliner-hacks-every-woman-must-know/\" target=\"_blank\" rel=\"noopener noreferrer\">cosmopolitan</a></p>\r\n<p>Eyeliner pensil bisa kamu gunakan untuk membuat smoky eyes, lho! Caranya mudah, kamu hanya perlu membuat tanda pagar di bagian ujung luar kelopak matamu, lalu baurkan dengan spons.</p>\r\n<h3>7. Diawali dengan berantakan</h3>\r\n<p>Wajar bagi pemula jika masih membuat eyeliner dan mendapatkan hasil yang agak berantakan. Kamu bisa gunakan concealer untuk menghapus bagian yang berantakan tersebut.</p>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3553.jpg\" alt=\"Cara memakai eyeliner\" width=\"637\" height=\"958\"></p>\r\n<p>Sumber: <a href=\"https://www.buzzfeed.com/nataliebrown/because-cat-eyes-are-hard?utm_term=.hdD4PQ0Xe#.oxBM6Djz0\" target=\"_blank\" rel=\"noopener noreferrer\">buzzfeed</a></p>\r\n<p>Tidak hanya dengan concealer, kamu bahkan bisa menggunakan sedikit petroleum jelly atau bahkan lip gloss untuk merapikan eyelinermu, lho!</p>\r\n<h3>8. Sambil menjepit bulu mata</h3>\r\n<p>Untuk kamu yang terburu-buru, kamu bisa menjepit bulu mata sambil mengaplikasikan eyeliner seperti cara unik yang satu ini, lho!</p>\r\n<p><img src=\"https://kawaiibeautyjapan.com/upload/gallery/3554.jpg\" alt=\"Cara memakai eyeliner\" width=\"637\" height=\"825\"></p>\r\n<p>Sumber: <a href=\"https://www.buzzfeed.com/nataliebrown/because-cat-eyes-are-hard?utm_term=.hdD4PQ0Xe#.oxBM6Djz0\" target=\"_blank\" rel=\"noopener noreferrer\">buzzfeed</a></p>','8-cara-jenius-untuk-memakai-eyeliner-bagi-pemula20171124234850','2017-11-25 05:48:50','azmicolejr','2017-11-25 05:50:03','azmicolejr'),(3,'Tips dan Cara Merawat Batik di Rumah','tips-dan-cara-merawat-batik-di-rumah','<p>Tips dan Cara Merawat Batik di Rumah – Kita sebagai orang Indonesia, wajib memilki pakaian batik di lemari pakaian kita. Apalagi setelah UNESCO menegaskan bahwa batik Indonesia adalah salah satu warisan budaya yang diakui dunia, desainer-desainer batik berlomba untuk membuat batik yang “kekinian”. Hal tersebut pasti membuat kita sebagai masyarakat Indonesia bangga, terutama bagi yang menyukai batik sebagai salah satu gaya berbusana. Tapi, hal tersebut juga harus diimbangi dengan cara merawat batik kesayangan agar kain batik tidak cepat rusak dan warna tidak mudah kusam.</p>\r\n<p>Nah, mau tahu beberapa tips dan cara ampuh merawat batik di rumah agar tetap awet dan terlihat baru setiap hari? Yuk, simak caranya di daftar berikut ini!</p>\r\n<p> </p>\r\n<p><strong>Hindari Mesin Cuci</strong><br>Memang mesin cuci bisa membantu dan mempercepat kamu untuk mencuci pakaian, tapi apa yang terjadi kalau batik kamu sering dicuci dengan mesin cuci? Serat-serat kain batik akan lebih mudah rusak. Pada umumnya membuat batik menggunakan tenaga dan metode manual, tapi enggak ada salahnya kalau sesekali mencuci batik kesayangan dengan menggunakan sentuhan tangan. Beberapa serat dari kain batik sangat tipis ataupun mudah rusak kalau kita salah dicuci, begitu juga dengan pola warnanya. Mencuci dengan tangan pastinya bisa menurunkan resiko rusaknya warna dan serat kain batik.</p>\r\n<p><strong>Pisahkan Batik dengan Bahan Lain</strong><br>Batik terbuat dari berbagai bahan dan warna yang mudah luntur dari pakaian lain tentu menjadi salah satu kendala kita dalam menjaga warna asli batik. Sebaiknya, sebelum mencuci baju batik, pisahkan dulu baju-baju kita yang mudah luntur dengan batik. Hal tersebut demi menjaga warna asli khas batik agar tetap cemerlang dan tidak terkontaminasi dengan warna lain.</p>\r\n<p><strong>Cuci Menggunakan Shampoo</strong><br>Bukan cuma rambut lho yang bisa dibersihkan dengan shampoo, baju batik juga bisa dicuci dengan shampoo. Shampoo pada dasarnya terbuat dari bahan aditif yang lembut banget dan untuk mencuci rambut. Tapi, hal tersebut juga bisa kita diaplikasikan ke batik. Kamu bisa mencoba mencuci batik kesayangan dengan menggunakan shampoo. Zat aditif yang terkandung dalam shampoo tidak sekeras yang ada di dalam detergen yang bisa untuk mencuci pakaian. Sehingga hal ini diyakini mampu menjaga batik agar tetap indah dalam waktu yang relatif lama.</p>\r\n<p><strong>Hindari Menggunakan Pelembut</strong><br>Softener atau pelembut pakaian seringkali kita gunakan untuk membuat kain lebih wangi dan harum saat dipakai, sehingga saat disimpan di dalam lemari, pakaian bisa langsung dikenakan ketika kita mau mengenakannya sehari-hari. Tapi, sisi lain negatif dari pelembut pakaian ini yaitu bisa membuat serat kain mudah rusak. Seringkali baju yang kita cuci dengan pelembut akan mudah robek dikemudian hari. Nah, maka itu dianjurkan untuk tidak menggunakan bahan ini ketika sedang mencuci batik.</p>\r\n<p><strong>Rendam dengan Air Hangat</strong><br>Toppers, kamu pasti familiar atau sering mendengar kalau mencuci batik harus dengan air dingin? Tapi, kalau kamu mau mencoba cara baru dan terbukti ampuh mencuci batik dengan bersih yaitu dengan menggunakan air hangat. Yup, air hangat dapat mempermudah melepaskan kotoran dari serat kain. Kalau batik tidak terlalu dalam keadaan kotor, daripada mengucek batik dengan tangan, lebih baik direndam dengan air hangat sekitar 20-30 menit agar kotoran lepas dan tinggal dibilas. Praktis, kan?</p>\r\n<p><strong>Hindari Menjemur di Bawah Sinar Matahari Langsung</strong><br>Menjemur pakaian langsung dibawah terik matahari di siang hari bisa membuat pakaian lebih cepat kering, tapi lain halnya dengan pakaian batik. Warna dan tekstur kain batik akan rusak bila dijemur di bawah sinar matahari langsung. Karena itu, mengeringkan kain batik cukup dengan menjemur di tempat yang teduh atau diangin-anginkan saja. Lebih lama memang, tapi cara ini membuat warna pada kain batik anda lebih awet.</p>\r\n<p>Kain batik yang merupakan kebanggaan Indonesia ini memang harus kita jaga dan rawat pemakaiannya. Dengan menghindari panas terik dan pelembut serta menggunakan air hangat, dijamin baju batik kamu bisa lebih bersih dan awet warnanya. Toppers, yuk memakai batik sebagai warisan budaya dari generasi ke generasi!</p>','tips-dan-cara-merawat-batik-di-rumah20171204042150','2017-12-04 10:21:50','azmicolejr',NULL,''),(4,'Tips Memilih Topi Sesuai dengan Bentuk Wajah','tips-memilih-topi-sesuai-dengan-bentuk-wajah','<p>Aksesoris merupakan salah satu hal yang penting dan dibutuhkan agar penampilanmu terlihat lebih keren, menarik, dan bisa terlihat maksimal setiap harinya. Apakah Toppers suka memakai topi sebagai salah satu aksesoris agar terkesan stylish dan keren? Topi yang dipakai juga harus sesuai dengan bentuk wajah kita lho, karena bisa membuat wajah lebih proporsional dan cocok dipakai sehari-hari.</p>\r\n<p>Mau tahu beberapa tips untuk memilih topi sesuai dengan bentuk wajahmu supaya lebih cocok untuk dipakai? Yuk, cari tahu infonya berikut ini.</p>\r\n<h2>Tips Memilih Topi Sesuai dengan Bentuk Wajah</h2>\r\n<h2> <img src=\"http://localhost/olshop2/assets/images/upload/a2d19e5458c9cf0998544bee4a53054b5.jpg\"></h2>\r\n<h3>Wajah Panjang</h3>\r\n<p>Kalau kamu memiliki bentuk wajah panjang, lebih baik memilih topi dengan pinggiran berbentuk bulat dan datar seperti topi jenis boater atau panama. Topi-topi dengan bentuk tersebut bisa menyamarkan dagu yang panjang sehingga wajah terlihat pas dan proporsional. Hindari menggunakan topi <a href=\"https://www.tokopedia.com/hot/topi-fedora\" target=\"_blank\" rel=\"noopener noreferrer\">fedora</a> karena bisa membuat wajah kamu terkesan lebih panjang dan lebar.</p>\r\n<h3>Wajah Oval</h3>\r\n<p>Kamu bisa dibilang beruntung jika memiliki wajah berbentuk oval karena semua jenis topi akan terlihat cocok dan tinggal memilih ukuran dan bentuk sesuai dengan seleramu. Tapi, bentuk topi yang disarankan untuk kamu yang memiliki wajah oval yaitu topi dengan model bulat bak bowler hat. Selain itu, topi model kupluk dengan bahan rajut atau topi beanie juga bisa dijadikan salah satu referensi untuk pria yang berwajah oval. Jangan menggunakan topi yang memiliki ukuran besar karena akan membuat wajahmu terlihat tertutup atau tenggelam.</p>\r\n<h3>Wajah Persegi</h3>\r\n<p>Banyak yang bilang kalau seseorang yang memiliki wajah persegi biasanya terkenal dengan sifatnya yang galak, sehingga banyak yang memiliki wajah persegi menggunakan topi untuk menutupinya. Nah, topi yang sesuai untuk Toppers yang berwajah persegi yaitu topi yang memiliki pinggiran berbentuk bulat misalnya floppy, bowler dan boaterhat. Model topi ini akan membuat wajah terlihat lebih lembut karena sudut tegas di wajah akan tertutupi dan lebih bulat. Topi berbentuk<a href=\"https://www.tokopedia.com/hot/baseball-cap\" target=\"_blank\" rel=\"noopener noreferrer\"> baseball cap</a> juga cocok karena bisa membuat kesan sporty dan dinamis.</p>\r\n<h3>Wajah Bulat</h3>\r\n<p>Toppers yang memiliki wajah bulat akan cocok menggunakan topi model fedora atau fedora hat. Karena, kalau kamu mengenakan topi ini maka wajahmu bisa terlihat lebih panjang dan ramping. Sebaiknya kamu menghindari menggunakan topi dengan model beanie dan bowler karena bisa membuat wajah kamu terlihat semakin bulat.</p>\r\n<h3>Wajah Hati</h3>\r\n<p>Wajah yang berbentuk hati sebenarnya nggak jauh berbeda dengan wajah berbentuk oval. Perbedaan dari kedua bentuk wajah ini sebenarnuya hanya bentuk wajah hati yang lebih meruncing di dagu dan lebar pada bagian dahi. Kalau kamu memiliki wajah dengan bentuk hati sebaiknya jangan menggunakan topi yang bisa membuat dagu terlihat makin tajam dan panjang. Topi dengan model cloche hat akan lebih cocok karena bisa membantu menyamarkan dahi yang lebar dan dagu yang agak panjang dan lancip tersebut.</p>\r\n<p>Sebelum membeli atau menggunakan topi, lebih baik kamu mengenali bentuk wajahmu dengan topi tersebut terlebih dahulu supaya lebih pas dan proporsional. Kamu bisa mencocokkan berbagai topi dengan bentuk wajah diatas sehingga saat menggunakannya, akan lebih menarik dan nyaman saat beraktivitas. Di Tokopedia kamu juga bisa menemukan berbagai jenis topi terlengkap dan terbaru, lho. Topi mana yang pas untukmu?</p>','tips-memilih-topi-sesuai-dengan-bentuk-wajah20171204042308','2017-12-04 10:23:09','azmicolejr','2017-12-04 10:49:24','azmicolejr'),(5,'Ketahui Berbagai Penyebab Diare dan Cara Mengatasi Diare','ketahui-berbagai-penyebab-diare-dan-cara-mengatasi-diare','<p>Meskipun tak tergolong serius, diare bukanlah penyakit yang boleh Toppers sepelekan, lho! Diare sendiri merupakan kondisi yang ditandai dengan encernya tinja yang dikeluarkan dengan frekuensi buang air besar (BAB) yang lebih sering dibandingkan dengan biasanya. Biasanya diare hanya berlangsung beberapa hari, namun pada sebagian kasus memanjang hingga berminggu-minggu.</p>\r\n<p>Gejala diare sendiri bisa dimulai dengan munculnya rasa sakit perut dan diikuti dengan frekuensi buang air besar yang jadi lebih sering dibandingkan biasanya. Tekstur tinja juga lebih encer. Pada kasus yang parah, Toppers bahkan bisa deman dan juga mengalami kram perut parah, lho!</p>\r\n<p>Nggak cuma bisa mengganggu aktivitas sehari-hari, diare bisa berakibat pada dehidrasi hingga malnutrisi karena asupan nutrisi yang jadinya tak terserap sempurna oleh tubuh. Tapi, Toppers nggak perlu khawatir karena diare bisa diatasi dengan mudah, kok. Sebelum mengetahui cara mengatasi diare, mari kita simak kebiasaan-kebiasaan dan berbagai hal yang bisa jadi penyebab Diare yang harus Toppers hindari.</p>\r\n<ol>\r\n<li><strong>Oralit sebagai pertolongan pertama mengobati diare</strong><br>Larutan oralit bisa dengan mudah Toppers temukan di apotik, toko obat-obatan, dan juga Tokopedia. Namun, oralit juga bisa dengan mudah dibuat sendiri dirumah, lho! Cukup larutkan satu sendok teh garam dan delapan sendok gula dengan satu liter air hangat. Minum larutan ini tiga hingga empat kali dalam sehari.</li>\r\n<li><strong>Perbanyak minum air putih</strong><br>Hindari mengonsumsi minuman yang memiliki rasa. Utamakan konsumsi air putih. Pada saat diare, tubuh membutuhkan cairan lebih karena tubuh rentan terkena dehidrasi. Minum air putih dengan frekuensi lebih namun dengan volum yang sedikit-sedikit.</li>\r\n<li><strong>Mengobati diare dengan Probiotik</strong><br>Bakteri jahat bisa dilawan menggunakan bakteri baik. Bakteri baik ini berupa probiotik yang banyak bisa ditemukan dari yoghurt dan juga keju.</li>\r\n<li><strong>Manfaatkan air rebusan daun jambu<br></strong>Kandungan flavanoid yang dimiliki daun jambu bermanfaat mengurangi cairang yang ada dalam feses secara progresif sehingga baik untuk mengurangi dampak dari diare. Cara menggunakan daun jambu untuk obat diare-pun sangat mudah. Cukup rebus 15 lembar daun jambu dengan 1 liter air. Tambahkan satu sedok teh garam hingga air berkurang kurang lebih setengahnya. Minum air rebusan daun jambu ini tiga kali sehari.</li>\r\n<li><strong>Teh Chamomile</strong><br>Sama halnya seperti daun jambu, teh Chamomile mengandung zar flavanoid yang bisa membantu mengobati diare. Namun, konsumsi teh ini secukupnya saja mengingat kandungan kafein yang terdapat pada teh juga tak baik untuk penderita diare.</li>\r\n<li><strong>Hindari makanan-makanan tertentu</strong><br>Saat terkena diare, perhatikan asupan makanan  yang masuk ke dalam tubuh. Berikut makanan-makanan yang perlu Toppers hindari saat menderita diare:\r\n<ul>\r\n<li>Makanan olahan susu, kecuali yoghurt</li>\r\n<li>Minuman-minuman berkafein dan beralkohol</li>\r\n<li>Makanan dengan kandungan asam tinggi</li>\r\n<li>Makanan dengan kandungan gula tinggi</li>\r\n<li>Makanan-makanan berminyak</li>\r\n</ul>\r\n</li>\r\n</ol>','ketahui-berbagai-penyebab-diare-dan-cara-mengatasi-diare20171204054411','2017-12-04 11:34:03','azmicolejr','2017-12-04 11:44:12','azmicolejr'),(6,'Sering Melamun Pertanda Cerdas?','sering-melamun-pertanda-cerdas','<p>Orang dengan pikiran kerap mengembara kemungkinan mempunyai otak lebih tajam. Sebuah studi menunjukkan bahwa orang yang terus menerus \"terganggu\" ternyata mempunyai \"memori kerja\" lebih banyak. Hal tersebut membuat mereka bisa melakukan dua hal bersamaan dalam satu waktu.Partisipan dalam penelitian ini harus menekan tombol sebagai respons terhadap munculnya huruf tertentu di layar atau menekan pada waktu yang tepat. Para peneliti mengecek secara rutin untuk mengetahui apakah pikiran mereka mengembara. Pada akhir penelitian, para ilmuwan mengukur kapasitas memori kerja partisipan, memberi mereka skor untuk kemampuan dalam mengingat sekumpulan huruf diselingi dengan pertanyaan matematika yang mudah.<br><br>Psikolog dari University of Wisconsin-Madison, Daniel Levinson, mengatakan mereka yang mempunyai kapasitas memori kerja lebih tinggi dilaporkan lebih sering melamun selama mengerjakan tugas-tugas sederhana meskipun prestasi mereka tidak meragukan. Hasil dari penelitian Levinson itu dipublikasikan secara online di Psychological Science. Ini pertama kalinya sebuah penelitian menunjukkan hubungan antara pikiran yang sering mengembara alias melamun dengan kecerdasan.<br><br>Levinson mengatakan dibutuhkan lebih banyak ruang kerja mental, misalnya, untuk menambahkan dua angka yang diucapkan tanpa menuliskannya. Kapasitas tersebut dihubungkan dengan pengukuran umum kecerdasan seperti membaca secara menyeluruh dan skor IQ.<br><br>Studi terbaru ini menggarisbawahi betapa pentingnya memori kerja untuk membantu otak fokus dalam masalah-masalah yang paling sulit.</p>','sering-melamun-pertanda-cerdas20180211095422','2017-12-04 11:35:55','azmicolejr','2018-02-11 15:54:22','armageddon');
