 juga akan menjadi lebih rileks dan segar sehingga dapat mencegah munculnya iritasi atau kemerahan pada kulit.\n• Untuk krim siangnya bisa dijadikan alas bedak sebelum anda memakai make up.\n• Membantu berbagai masalah pada kulit kering yang terlihat tua dan kusam.\n\nKegunaan Acne/Jerawat :\n• Membantu mengurangi produksi minyak berlebih pada wajah.\n• Menghilangkan jerawat dan bekasnya.\n• Mengurangi munculnya jerawat dan membuat kulit tampak bersih.\n• Membantu meregenerasi kulit.\n• Mengencangkan dan mengenyalkan kulit.\n\nKegunaan Ultimate/Flek :\n• Flek karena cacar.\n• Flek karena sengatan matahari.\n• Flek hitam karena pemakaian alat kontrasepsi KB.\n• Flek hitam karena ketidakcocokan produk kosmetik sebelumnya.\n• Flek hitam yang timbul karena faktor usia senja.\n• Flek hitam yang memang faktor genetik atau bawaan dari lahir.\n\n1 Paket  Isinya :\nPaket MS GLOW Whitening \nPaket MS GLOW Ultimate\nPaket MS GLOW Acne Series\nPaket MS GLOW Body Series (Paket Body Whitening)\nPaket Red Jelly MS GLOW',15,'0.0',12,6,NULL,280000,0,330000,120,'2019-08-19 02:55:16','2019-08-19 03:00:24'),(110,241,'NU AMOOREA','nu-amoorea','nu amoorea','Manfaat sabun pemutih wajah nu amoorea:\n\nDapat efektif dalam memutihkan kulit\nMampu menyeimbangkan ph kulit\nMembuat kulit tamoak kenyal dan putih sepanjang hari\nAmpuh dalam mengurangi masalah mata panda\nMampu melembabkan kulit secara maksimal\nMampu mengetasi masalah jerawat dan bekasnya\nBisa menghilangkan flek hitam bekas jerawat\nMampu menghilangkan kerutan\nMembuat kulit wajah senantiasa awet muda.\n\nCara pakai sabun nu amoorea untuk wajah:\n\nBershkan wajah terlebih\nKemudaian busakan sabun NU AMOOREA asli pada telapak tangan\nKemudian oleskan keseluruh bagian wajah secara merata sampai ke leher (JANGAN SAMPAI DIGOSOK) hanya dioleskan.\nSetelah itu biarkan selama 10 menit atau sampai mengering, lalu b sampai bersih\nGunakan sabun AMOOREA 2 kali sehari untuk hasil yang maksimal.\n\n\n15gr Stemcell \n25gr Nano/Reguler\n40gr 